import React from 'react';
import "./Avatar.css";
const avt={
    name:"Avatar",
    icon:"https://vaithuhayho.com/wp-content/uploads/2021/03/anh-avatar-dep-21.jpg"
}
function Avatar() {
    return (
      <>
          <img alt={avt.name} className={avt.name} src={avt.icon}/>
      </>
    );
  }
  

export default Avatar;
